script: |
  super -f text -I q13226.spq | sort > q13226.out

inputs:
  - name: q13226.spq
    data: |
      SELECT + 52 + - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 40 * col0 + col0 NOT BETWEEN - 18 / col1 + - col0 AND ( - 72 );
  - name: tab2

outputs:
  - name: q13226.out
    data: |
      -6
      12
      29
